import './App.css';


import Card from './components/card/card';
import {ColorLetter } from './components/colorLetter/colorLetter';
import Hand from './components/hand/hand';
import Logo from './components/logo/logo';
import Pipo from './components/assets/Pipo.png';
import Chuky from './components/assets/Chuky.png';
import Lupo from './components/assets/Lupo.png';



function App() {
    const handOfMonsters=[
      {name:"Pipo",color:"#F2DFDF",img:Pipo},
      {name:"Chuky",color:"#6BBABB3B",img:Chuky},
      {name:"Lupo",color:" #525FA754",img: Lupo}

    ];



    return (
    <div className="App">
         <Logo />
         <Hand monsters ={handOfMonsters}  />

    </div>
    );
};

export default App;
